CREATE TABLE IF NOT EXISTS `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `active` tinyint(4) DEFAULT NULL,
  `login` varchar(50) NOT NULL,
  `attempts` int(11) DEFAULT NULL,
  `last_try` datetime DEFAULT NULL,
  `token` varchar(128) DEFAULT NULL,
  `id_uin` int(11) DEFAULT NULL,
  `id_role` int(3) DEFAULT NULL,
  `pass` varchar(50) NOT NULL DEFAULT md5(`login`),
  `phone` varchar(20) DEFAULT NULL,
  `lastname` varchar(50) DEFAULT NULL,
  `firstname` varchar(50) DEFAULT NULL,
  `secondname` varchar(50) DEFAULT NULL,
  `hash` varchar(50) NOT NULL DEFAULT unix_timestamp(current_timestamp()),
  `avatar` mediumtext DEFAULT NULL,
  `creation` datetime DEFAULT current_timestamp(),
  `social_tg` tinytext DEFAULT NULL,
  `social_in` tinytext DEFAULT NULL,
  `social_vk` tinytext DEFAULT NULL,
  `gender` tinyint(1) DEFAULT NULL,
  `phone_work` varchar(20) DEFAULT NULL,
  `email` varchar(50) DEFAULT NULL,
  `age` date DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `UL` (`login`),
  KEY `FK_roles_users` (`id_role`) USING BTREE,
  KEY `FK_users_uin` (`id_uin`)
) ENGINE=MyISAM AUTO_INCREMENT=35 DEFAULT CHARSET=utf8 COMMENT='Пользователи';

